                    const boardRect = this.gameBoard.getBoundingClientRect();
                    const newBoardSize = Math.min(boardRect.width, boardRect.height);
                    
                    this.player.boardSize = newBoardSize;
                    this.enemy1.boardSize = newBoardSize;
                    this.enemy2.boardSize = newBoardSize;
                    
                    this.player.updatePixelPosition();
                    this.enemy1.updatePixelPosition();
                    this.enemy2.updatePixelPosition();
                    
                    this.player.targetX = this.player.pixelX;
                    this.player.targetY = this.player.pixelY;
                    this.enemy1.targetX = this.enemy1.pixelX;
                    this.enemy1.targetY = this.enemy1.pixelY;
                    this.enemy2.targetX = this.enemy2.pixelX;
                    this.enemy2.targetY = this.enemy2.pixelY;
                    
